import React from 'react'
import PropTypes from 'prop-types'

function LoadingSkeleton(props) {
  return (
    <div className={props.class}></div>
  )
}

LoadingSkeleton.propTypes = {
  class:PropTypes.string,
}

export default LoadingSkeleton
